import 'package:beautiful_soup_dart/beautiful_soup.dart';
import 'package:dio/dio.dart';
import 'package:lectio_wrapper/utils/controller.dart';
import 'package:lectio_wrapper/utils/dio_client.dart';
import 'package:lectio_wrapper/utils/scraping.dart';

class ProfileController extends Controller {
  ProfileController(super.student);

  /// Returns true if the profile picture was changed
  Future<bool> changeProfilePicture() async {
    var submitUrl = student
        .buildUrl("PhotoDialog.aspx?selectedEntityId=S${student.studentId}");

    var profilePage = await request<String>(submitUrl);
    Map<String, String?> extracted =
        extractASPData(BeautifulSoup(profilePage.data as String), "__Page");
    extracted["__EVENTARGUMENT"] = "GEM";
    extracted[r"ctl00$Content$imageDataUrlHidden"] =
        """data:image/png;base64,""";
    var body = await request<String>(submitUrl,
        data: extracted,
        options: Options(
            followRedirects: false,
            method: "POST",
            contentType: "application/x-www-form-urlencoded",
            headers: {
              "Cache-Control": "no-cache",
              "Referer": "https://www.lectio.dk"
            }));
    return !(body.data?.contains("rettigheder") ?? true);
  }
}
